#!/bin/bash
gcc main.c -o putchar_solution
gcc main2.c -o write_solution
echo "PUTCHAR SOLUTION:"
COUNTER=0
while [ $COUNTER -lt 10 ];
do
	time ./putchar_solution "" | grep real
	let COUNTER=COUNTER+1 
done
echo ""
echo "PUTCHAR SOLUTION:"
COUNTER=0
while [ $COUNTER -lt 10 ];
do
	time ./write_solution "" | grep real
	let COUNTER=COUNTER+1 
done
